style.css:
body {
  background-image: url('https://i.gifer.com/1dJt.gif');
  background-size: cover;
  background-attachment: fixed;
}

p, h1, h2, h3 {
  color: #004d00;
}

a {
  color: #006600;
  text-decoration: none;
}

a:hover {
  text-decoration: underline;
}

button {
  background-color: #004d00;
  color: #ffffff;
  border: none;
  padding: 10px 20px;
  border-radius: 5px;
}

button:hover {
  background-color: #006600;
}
